                 )

             } */}
             {
                 isAuthor ? (
                     <div>
                    <button>Delete</button>
                    <button>Edit</button>
                    <button>View</button>
                    </div>
                 ) :(<button>View</button>)
             }
             </div>
             )  
           }) 
        }
        </div>
    )
}

